INSERT INTO `projekat2` VALUES (1,'David','Skulptura','Michelangelo di Lodovico Buonarroti Simoni','Italija','david1.jpg','Michelangelov David radjen od 1500. do 1504., remek-djelo je kiparstva renesanse i jedno od Michelangelova dva najveca kiparska djela, zajedno s Pietom. Sam David smatra se jednim od najprepoznatljivijih kiparskih djela na svijetu, a postao je vaznim simbolom ljudske snage i mladenacke ljepote. 5,17 metara visok mramorni kip portretira Biblijskog lika Kralja Davida u trenutku kad se jos, kao mladic, sukobio s divom Golijatom. Postao je i simbol Firentinske republike, nezavisnog grada-drzave pod prijetnjama sa svih strana mocnijih neprijateljskih drzava. Dovrseni kip otkriven je 8. rujna 1504.');
